  \"2016-07-27T23:04:12.494585\",\n\t\"name\": \"mobile-acoustical-bat-monitoring-annual-summary-report-cy-2012-to-2015-roanoke-river-natio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These reports summarize bat calls collected
  along transects at Roanoke River NWR between 2012 and 2015. Calls were classified
  using Bat Call ID ([BCID] version 2.5a) software and restricted to calls with 5
  or more pulses.  This annual summary report contains summary information on transect
  surveys, species detections, maps of species locations.  Summary tables include
  all classified species observations including those that did not have an associated
  spatial reference. The report summarizes acoustical bat data from a survey route
  run at Roanoke River NWR between 2012 and 2015.\",\n\t\"license_title\": \"License
